// Scala
class JaxbResponseConverter(context: JAXBContext, type: Class[_]) 
  extends Converter[Response, T] {

  def convert(response: Response): T = {
    /* BUG:
     * type.cast(unmarshal(response.getBody.in()));
     * FIXED: 
     */
    type.cast(unmarshal(response.getBody.in())).asInstanceOf[T]
  }

  private def unmarshal(body: InputStream): AnyRef = {
    context.createUnmarshaller().unmarshal(body);
  }

